import React from "react";
import styles from "../styles/components/forecast-table.module.scss";
import { TempDisplay } from "./TempDisplay";
import { WeatherDisplay } from "../store";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";

type ForecastTableProps = {
  forecast: WeatherDisplay[];
};

export const ForecastTable: React.FC<ForecastTableProps> = ({ forecast }) => {
  return (
    <DataTable value={forecast} tableStyle={{ minWidth: "60rem" }}>
      <Column field="name" header="Name"></Column>
      <Column header="Image"></Column>
      <Column field="price" header="Price"></Column>
      <Column field="category" header="Category"></Column>
      <Column field="rating" header="Reviews"></Column>
      <Column header="Status"></Column>
    </DataTable>
  );
};

